import React, { Component } from "react";
import { Link } from "react-router-dom";

import Header from "../../components/dashboard/header";
import Sidebar from "../../components/dashboard/sidebar";

import Chart from "chart.js"

import styles from "../../styles/dashboard/index.module.scss";
import Analysis from "../../components/analytics/analysis";


class Dashboard extends Component{
    
     componentDidMount(){
        let draw = Chart.controllers.line.prototype.draw;
        Chart.controllers.line = Chart.controllers.line.extend({
            draw: function() {
                draw.apply(this, arguments);
                let ctx = this.chart.chart.ctx;
                let _stroke = ctx.stroke;
                ctx.stroke = function() {
                    ctx.save();
                    ctx.shadowColor = '#8AF1B9';
                    ctx.shadowBlur = 100;
                    ctx.shadowOffsetX = 0;
                    ctx.shadowOffsetY = 20;
                    _stroke.apply(this, arguments)
                    ctx.restore();
                }
            }
        });
        var ctx = document.getElementById('myChart');
        new Chart(ctx, {
            type: 'line',
            data: {
                labels: ['a','b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j'],
                datasets: [{
                    label: 'Bookings analysis',
                    data: [50, 46, 50, 45, 50, 10, 30, 60, 80, 5],
                    backgroundColor: [
                        'transparent'
                    ],
                    pointBackgroundColor: ['#c4c4c4'],
                    borderColor: [
                        "#c4c4c4"                        
                    ],
                    borderWidth: 1,
                    display: false
                }]
            },
            options: {
                maintainAspectRatio: false,
                scales: {
                    yAxes: [{
                        display: false,
                        // ticks: {
                        //     beginAtZero: true
                        // },
                        gridLines: {
                            display: false,
                            color: "black"
                        },
                    }],
                    xAxes: [{
                        display: false,
                        ticks: {
                            beginAtZero: true
                        },
                        gridLines: {
                            display: false,
                            color: "black"
                        },
                    }]
                },
                layout: {
                    padding:5
                },
                legend: {
                    display: false
                }
            }
        });
    }

    render(){
        return(
            <div>
                <div>
                    <div className="content-container">
                        <Header />
                        <Sidebar />
                        <div className="content">

                            <div className={styles.wrapper}>
                                <div className={styles.classes}>
                                    <div className={styles.welcome}>
                                        <div className={styles.wText}>
                                            <h1>Welcome back, <span>john.</span></h1>

                                            <p>You're doing great this week, keep it up!
                                                <span>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Erat lacus sed enim sit egestas tellus. Imperdiet elementum lacus. sit amet, consectetur adipiscing elit.
                                                </span>
                                            </p>
                                            
                                            <Link to="/create-class" className={styles.wLink}>create class</Link>
                                        </div>

                                        <img src={welcome} alt="welcome svg"/>
                                    </div>
                                    <div className={styles.slides}>
                                    </div>
                                </div>

                                <div className={styles.analytics}>
                                    <div className={styles.wrapper}>
                                        <Analysis icon={Tclass} title="Total classes" number="105" />
                                        <Analysis icon={Tbook} title="Total bookings" number="1154" />
                                        <Analysis icon={Tearn} title="Total earnings" number="NGN 111,595,000" />
                                        <Analysis icon={Tavg} title="average weekly bookings" number="372" />
                                    </div>

                                    <div className={styles.chart}>
                                        <div className={styles.chartNav}>
                                            <h3>
                                                Analytics
                                            </h3>

                                            <span className={styles.dura}>
                                                weekly                                                
                                                <svg width="12" height="8" viewBox="0 0 12 8" fill="none" xmlns="http://www.w3.org/2000/svg">
                                                <path d="M1.41 0L6 4.58L10.59 0L12 1.41L6 7.41L0 1.41L1.41 0Z" fill="white" />                                                </svg>
                                                
                                                <a className={styles.duraOpt}>
                                                    options
                                                </a>
                                            </span>
                                        </div>
                                        
                                        <div className={styles.chartWrapper}>
                                            <canvas id="myChart" width="330" height="145"></canvas>
                                        </div>
                                    </div>
                                </div>
                            </div>  
                            
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Dashboard;
